import React from "react";
import "../../../../Styles/Pages/MonsterArena/MonsterNews/MonsterNewsCard.scss";

function MonsterNewsCard() {
  return (
    <div className='monsterNewsCard'>
      <h1>Monster Arena: World</h1>
      <div className='monsterNewsCard__container'>
        <h4>NEWS</h4>
        <h3>Monster Arena: World coming soon</h3>
        <p>
          We have been working with a new season of Monster Arena: World adding
          new monsters.
        </p>
      </div>
    </div>
  );
}

export default MonsterNewsCard;
